import React,{useState, useEffect} from 'react'
import axios from 'axios'
export default function Details() {
    const [post, setPost] = React.useState([]);
    const [changeValue, setchangeValue] = useState(false);

    React.useEffect(() => {
      axios.get('https://jsonplaceholder.typicode.com/todos').then((response) => {
        setPost(response.data);
        console.log(post)
      });
    }, []);


    const funct = () => {
        setchangeValue(true)
        console.log("hiii", changeValue)
    }
    return (
        <div>
            <h1>This has logined :)</h1>
            <div className='data'>
                {post.map((item)=>
                    <div className='details'>
                        <p> <b>UserId = </b>{item.userId}</p>
                        <p> <b>Id = </b>{item.id}</p>
                        {item.completed?
                            <p> <b>Title =</b> <span  id='true'>{item.title}</span></p>:
                            <p> <b>Title =</b> <span onClick={funct} id='false'>{item.title}</span></p>
                        }
                        {/* <p> <b>Title =</b> <span>{item.title}</span></p> */}
                        {/* <p> <b>Completed = </b><button className='bool-value'>{item.completed}</button></p> */}
                    </div>)}
                {changeValue}
            </div>
            {console.log(post)}

        </div>
    )
}
